div.div:
Questa parte è composta da dei registri (piccole locazioni da 32 bit), essi si dividono in:
Generali--> riservati alle elaborazioni;
Di stato--> riservati a compiti speciali;
Possiamo riferirci ai registri generali anche in altri modi, in paricolare possiamo riferirci ai 16 bit bassi di tutti i registri generali (per retrocompatibilità), ed anche ad alcune parti a 8 bit per una parte di essi.
-Riferirsi alla struttura riportata accanto-
